import React from 'react';
import {
  Box,
  ModalBody,
  Button,
  Link,
  useColorModeValue,
} from '@chakra-ui/react';
import { BsPlay, BsFileEarmarkCode } from 'react-icons/bs';

const Linter = props => {
  const firstColor = useColorModeValue('red', 'yellow');
  return (
    <Box mt={2} {...props}>
      <ModalBody>
        <Button leftIcon={<BsPlay />} colorScheme={firstColor} size="lg" mr={5}>
          <Link
            as="a"
            _hover={{ textDecor: 'none' }}
            href="https://autocomplete-me.herokuapp.com/"
            isExternal={true}
          >
            Try Now
          </Link>
        </Button>
        <Button leftIcon={<BsFileEarmarkCode />} colorScheme="blue" size="lg">
          <Link
            as="a"
            _hover={{ textDecor: 'none' }}
            href="https://github.com/kevinlin1/nifty-web-apps"
            isExternal={true}
          >
            View Source Code
          </Link>
        </Button>
        <br />
        <br />
      </ModalBody>
    </Box>
  );
};

export default Linter;
